import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import NavBar from './layout/NavBar';
import Home from './pages/Home';
import { BrowserRouter, Routes, Route, Router } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Home />
        <Routes></Routes>
      </Router>
    </div>
  );
}

export default App;
